import React, { Fragment, Component } from "react";
import "./App.css";

//function based component
// const App = () => {

//class based component
class App extends Component {
  render() {
    const name = "Shayan Abedi";
    const loading = false;

    return (
      <div className="App">
        <h1>Github finder!</h1>
        <p>Made by {name}</p>
        {loading ? <p>Loading....</p> : null}
      </div>
    );
  }
}

export default App;
